function delRecentSearch(cName){
	fnDelCookie(cName);
	setRecentSearchHtml();
}

function setRecentSearchHtml(){
	var count = 0;
	var html = "";
	html += '';
	html += '<dt class="txt-label">'+Granite.I18n.get("Recent Search",csSiteCode, csI18nHint)+'</dt>';
	for(var i=0 ;i<3; i++){
		var cName = "cs_"+csSiteCode+"_recentSearch"+i;
		var getRecentSearch = fnGetCookie(cName);
		if(getRecentSearch !== ""){
			html += '<dd>';
			html += '<a href="' + fnLinkUrl(csRoot+"/search") + "?keyword="+encodeURI(getRecentSearch) + '" class="txt-link">'+getRecentSearch+'</a>';
			html += '<button type="button" class="sich close type2" onclick="delRecentSearch(\''+cName+'\')">'+Granite.I18n.get("word delete",csSiteCode, csI18nHint)+'</button>';
			html += '</dd>';
			count++;
		}
		
	}
	$(".list-link").html(html);
	if(count === 0){
		$("#recentSearchDiv").hide();
	}else{
		$("#recentSearchDiv").show();
	}
}
