function fnSupportSearch(e) {
	var obj = e.target || e.srcElement;
    if (e.keyCode === 13) {
		
		var requestNtt = $(obj).val();
		var searchUrl = fnLinkUrl("/content/samsung/"+csSiteCode+"/support/search") + "?keyword="+encodeURIComponent(requestNtt);
		
        window.location.href = searchUrl;
    } else {
    	supportSearchAjax(obj);
	}
}

function supportSearchAjax(obj){
	var requestSiteCode = $("input[name=sitecode]").val();
	var requestNtt = $(obj).val();

	if(requestNtt.length<2){
		$("#appendTarget").hide();
		return;
	}
	
	var strUrl = "/aemapi/support/common/keyvisualSearch";
	$.ajax({
		type: "POST",
		data: {
			"requestSiteCode" : requestSiteCode
			,"requestNtt" : requestNtt
			},
		url: strUrl,
		success: function (data) {
			
			 var html = '';
			 var requestNttTemp = requestNtt;
			 
			 var tempCnt = 0;
			 while(requestNttTemp.lastIndexOf(" ") > -1 && requestNttTemp.lastIndexOf(" ") === requestNttTemp.length - 1){
				 requestNttTemp = requestNttTemp.substring(0, requestNttTemp.lastIndexOf(" "));
				 
				 tempCnt++;
				 if(tempCnt > 10) break;
			 }
			 
			 if(data.pdpResultList.length > 0){
				var pdpResultList = data.pdpResultList;
				$.each(pdpResultList, function (index, pdpResult) {
					var pcImageUrl = fnDataCheck(pdpResult.autoThumbUrl, strNoImagePc);
					html += '<li class="photo">';
					html += '	<a href="'+pdpResult.u+'" data-omni="' + fnDataCheck(pdpResult.modelCode) + ',' + fnDataCheck(pdpResult.modelName) + '">';
					html += '		<span class="cell cell-img">';
					html += '			<img src="'+pcImageUrl+'" alt="'+pdpResult.fmyMktNm+'" />';
					html += '		</span>';
					
					var modelName = fnDataCheck(pdpResult.fmyMktNm);
					var str = boldReplace(modelName, requestNttTemp, '<span class="mark">', '</span>');
					html += '		<span class="cell cell-txt">'+str+' ('+fnDataCheck(pdpResult.modelCode)+')</span>';
					html += '	</a>';
					html += '</li>';
				});
			 }
			 
			 if(data.helpCtntResultList.length > 0){
				 var helpCtntResultList = data.helpCtntResultList;
				 $.each(helpCtntResultList, function (index, helpCtntResult) {
					var productTitle = fnDataCheck(helpCtntResult.contentsTitle);
					var str = boldReplace(productTitle, requestNttTemp, '<span class="mark">', '</span>');	
					
					html += '<li><a href="javascript:fnSolutionPopup(\''+helpCtntResult.u+'\')" title="'+ Granite.I18n.get("Open new window", csSiteCode, csI18nHint) + '">'+str+'</a></li>';
				 });
			 }
			 
			 $("#appendTarget").html(html);
			 
			 $(obj).trigger("keyupCallback");
        }
	});		
}
$(function(){
    $("a[data-click='newsmodal']").click(function(e){
    	e.preventDefault();
    	
    	var $this = $(this);
    	var newsLink = $this.attr('href');
    	var newsId = newsLink.substr(newsLink.lastIndexOf('/')+1);

    	var object = {};
    	object.requestSiteCode = csSiteCode;
    	object.requestNewsId = newsId;
		
		var strUrl = "/aemapi/support/newsalerts/newsdetail";
		
		$.ajax({
			type: "POST",
			data: object,
			url: strUrl,
			success: function (data) {
				var newsDetailList = data.newsDetailModel.newsDetail;
				
				var popup_html = '';

				if (newsDetailList.length > 0) {
					$.each(newsDetailList, function (index, newsDetail) {
						popup_html += '<div class="detail-top">';
						popup_html += '    <span class="tag ' + fnNewsCodeToValue(newsDetail.code) + '"><span>' + newsDetail.codeEnglishName + '</span></span>';
						popup_html += '    <h2 class="detit">';
						popup_html += '        <p class="txt"> ' + newsDetail.newsMainTitle + '</p>';
						popup_html += '    </h2>';
						popup_html += '    <div class="spec-w">';
						popup_html += '        <p class="model"> # ' + newsDetail.newsCategory + '</p>';
						popup_html += '        <p class="date">' + newsDetail.updateDate + '</p>';
						popup_html += '    </div>';
						popup_html += '</div>';
						popup_html += '<div class="detail-cont">';
						if (newsDetail.imgFileUrl) {
							popup_html += '    <img src="' + newsDetail.imgFileUrl + '" alt="' + newsDetail.newsMainTitle + '"/><br><br>';
						}
						popup_html += '    <p>' + newsDetail.newsContent + '</p>';
						popup_html += '</div>';
					});
				} else {
					popup_html = 'no data';
				}
		    	
		        fnModalDialog($this, popup_html, 'lg');
	        }
		});
    });
    
    function fnNewsCodeToValue(code) {
    	var result = 'tag3';
    	
    	if (code === 'SN-A') {
    		result = 'tag1';
    	} else if (code === 'SN-N') {
    		result = 'tag2';
    	}
    	
    	return result;
    }
});
