function modelNumberSearch(e){
	var objThis = e.target || e.srcElement;
    if (e.keyCode) {
    	modelNumberSearchAjax(objThis);
	}
}

function modelNumberSearchAjax(objThis){
	var requestSiteCode = $("input[name=sitecode]").val();
	var i18n_sitecode = "cs_" + requestSiteCode;
	var requestNtt = $(objThis).val();
	var $autowordLayEl = $(objThis).parent().parent().parent().find('div.autoword-lay');
	var $awListEl = $autowordLayEl.find('ul.aw-list');
	
	if(requestNtt.length<2){
		$awListEl.html('<li></li>');
		$(".has-iscroll").removeClass("vhide");
		$(".has-iscroll").trigger("refresh");
		if($autowordLayEl.hasClass("nodata-lay")){
			$autowordLayEl.removeClass("nodata-lay");
		}
		return;
	}
	
	var strUrl = "/aemapi/support/common/modelnumberSearch";
	
	$.ajax({
		type: "POST",
		data: {
			"requestSiteCode" : requestSiteCode
			,"requestNtt" : requestNtt
			,"requestNum" : "100"
			},
		url: strUrl,
		success: function (data) {
			
			 var html = '';
			 if(data.modelResultList.length > 0){
				var modelResultList = data.modelResultList;
				$.each(modelResultList, function (index, modelResult) {
					
					var modelCode = boldReplace(fnDataCheck(modelResult.modelCode), requestNtt, '<strong class="sort">', '</strong>');	
					
					var fmyMktNm = boldReplace(fnDataCheck(modelResult.fmyMktNm), requestNtt, '<strong class="sort">', '</strong>');	
				
					html += '<li><a href="'+modelResult.u+'" data-omni="' + fnDataCheck(modelResult.modelCode) + ',' + fnDataCheck(modelResult.modelName) + '">'+fmyMktNm+' ('+modelCode+')</a></li>';
				});
				if($autowordLayEl.hasClass("nodata-lay")){
					$autowordLayEl.removeClass("nodata-lay");
				}
			 }else{
				 html += '<li class="aw-nodata"><span>' + Granite.I18n.get("Please enter a valid model name or number", requestSiteCode, i18n_sitecode) + '</span></li>';
				 if(!($autowordLayEl.hasClass("nodata-lay"))){
					 $autowordLayEl.addClass("nodata-lay");
				 }
			 }
			 $awListEl.html(html);
			 $(".has-iscroll").removeClass("vhide");
			 $(".has-iscroll").trigger("refresh");
		
        }
	});		
	
}
