function fnClearCombo(step){
	switch(step){
	case 1 :
		$(".combo-1depth .combo-opt").html("");
		$(".combo-1depth .current").html("");
		$(".combo-2depth .combo-opt").html("");
		$(".combo-2depth .current").html("");
		$(".combo-3depth .combo-opt").html("");
		$(".combo-3depth .current").html("");
		
		if($(".typeNumberLayer .combo-box-item").hasClass("active")){
			$(".typeNumberLayer .combo-box-item").removeClass("active");
		}
		$(".slider-list").html("").trigger("dataModify");
		break;
	case 2 :
		$(".combo-2depth .combo-opt").html("");
		$(".combo-2depth .current").html("");
		$(".combo-3depth .combo-opt").html("");
		$(".combo-3depth .current").html("");
		$(".slider-list").html("").trigger("dataModify");
		break;
	case 3:
		$(".combo-3depth .combo-opt").html("");
		$(".combo-3depth .current").html("");
		$(".slider-list").html("").trigger("dataModify");
		break;
	default:
		break;
	}
}

